import React, { Component } from 'react';

export default class CardsSaves extends Component {
  render() {
    const { cards } = this.props;

    return (
      <div>
        <ul>
          { cards.map((card) => (
            <li key={ card.cardName }>{ card.cardName }</li>
          )) }
        </ul>
      </div>
    );
  }
}
